import React from "react";
import Grid from "@material-ui/core/Grid";

function Features() {
  return (
      <Grid container>
        <Grid item>
          <Grid item xs='auto'>
            one
          </Grid>
          <Grid item xs='auto'>
            two
          </Grid>
          <Grid item xs='auto'>
            three
          </Grid>
        </Grid>
      </Grid>
  );
}

export default Features;
